// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/token/ERC20/utils/SafeERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "./interface/IAggregatorV3.sol";
import "./interface/ISynthetic.sol";
import "./interface/ISystemCoin.sol";
import "./interface/IUSBPool.sol";

contract SyntheticPool is Initializable, UUPSUpgradeable, PausableUpgradeable, OwnableUpgradeable {

    using SafeERC20Upgradeable for IERC20Upgradeable;
    using SafeERC20Upgradeable for ISynthetic;
    using SafeERC20Upgradeable for ISystemCoin;

    uint256 internal BIPS_DIVISOR;                          // Constant 10000(denominator)
    uint256 internal tolCloseMargin;
    uint256 internal maxAmount;
    uint256 internal txFee;
    address internal reservePool;
    ISystemCoin internal systemCoin;
    IUSBPool internal USBPool;

    uint256 internal poolLength;
    mapping(uint256 => uint256) internal poolOrderLength;                                       // PoolId => orderLength
    mapping(uint256 => mapping(address => uint256)) internal userOrderLength;                   // PoolId => userAddress => userOrderLength

    uint256 internal totalTxAmount;
    uint256 internal minSystemCoinTxAmount;                                                     // min system Coin amount for order
    uint256 internal minSynTokenTxAmount;    
    uint256 internal synPoolPriceDecimal;
    mapping(address => bool) public authorized;
    mapping(address => uint256) internal synPoolPrice;                                          // Pool price
    mapping(uint256 => mapping(uint256 => OrderInfo)) public orderInfo;                         // PoolId => PoolOrderId => OrderInfo
    mapping(uint256 => mapping(address => mapping(uint256 => uint256))) public userOrderId;     // PoolId => UserAddress => userOrderLength => PoolOrderId
    mapping(uint256 => PoolInfo) public poolInfo;                                               // PoolId => PoolInfo

    struct OrderInfo {
        address account;
        uint128 systemCoinAmount;       // System stable coin
        uint128 minSystemCoinAmount;
        uint128 synTokenAmount;
        uint128 minSynTokenAmount;         // Synthetic token
        uint32 orderId;
        uint64 synTokenPrice;              // 8 decimals
        uint64 openTime;
        uint64 closeTime;
        uint8 orderType;              // only accept 0/1, 0 = buy, 1 = sell
        uint8 status;                    // 0 = open, 1 = close, 2 = cancel
    }

    struct PoolInfo {
        ISynthetic syntheticToken;          // Synthetic stock token address
        IAggregatorV3 oracleChainlink;      // oracle stock price(future usage to replace stockPrice variable)
        uint256 txAmount;                   // Transaction amount
        bool mintsEnabled;
        bool burnsEnabled;
    }

    event SetEmergency(address indexed sender, uint256 emergencyStart);
    event OpenOrder(uint256 indexed pid, uint256 indexed orderType, uint256 orderId, address indexed account, uint256 systemCoinAmount, uint256 minSystemCoinAmount, uint256 synTokenAmount, uint256 minSynTokenAmount, uint256 synTokenPrice);
    event MintSynToken(uint256 indexed pid, address indexed sender, address indexed account, uint256 systemCoinAmount, uint256 synTokenAmount);
    event BurnSynToken(uint256 indexed pid, address indexed sender, address indexed account, uint256 systemCoinAmount, uint256 synTokenAmount);
    event CancelOrder(uint256 pid, uint256 orderId, address account);
    event UpdateOrder(uint256 pid, uint256 orderId, uint256 systemCoinAmount, uint256 synTokenAmount);
    event PoolsEnabled(uint256 pid, bool newMintsEnabled, bool newBurnsEnabled);

    modifier onlyAuthorized() {
        require(authorized[msg.sender] || owner() == msg.sender);
        _;
    }

    modifier notZeroAddress(address inputAddress) {
        require(inputAddress != address(0) , "collateralVault : input zero address");
        _;
    }

    /******************************************* INITIAL SETUP START ******************************************/
    // Init the contract. Can only be called by the owner. 
    function initContract(address _reservePool, address _systemCoin, address _USBPool, uint256 _minSystemCoinTxAmount, uint256 _minSynTokenTxAmount, uint256 _txFee, uint256 _tolCloseMargin, uint256 _synPoolPriceDecimal) external onlyOwner{
        require(_reservePool != address(0),"RP!=0");
        require(_systemCoin != address(0),"SC!=0");
        require(_USBPool != address(0),"USB!=0");
        reservePool = _reservePool;
        systemCoin = ISystemCoin(_systemCoin);
        USBPool = IUSBPool(_USBPool);
        minSystemCoinTxAmount = _minSystemCoinTxAmount;
        minSynTokenTxAmount = _minSynTokenTxAmount;
        txFee = _txFee;
        tolCloseMargin = _tolCloseMargin;
        synPoolPriceDecimal = _synPoolPriceDecimal;
    }

    function add(address _synToken, address _oracle) external onlyOwner {
        require(address(_synToken) != address(0), "ST!=0");
        poolInfo[poolLength] = PoolInfo({
            syntheticToken : ISynthetic(_synToken),
            oracleChainlink : IAggregatorV3(_oracle), 
            txAmount : 0,
            mintsEnabled : true,
            burnsEnabled : true
        });
        poolLength++;
    }

    /****************************************** Synthetic CORE FUNCTION ******************************************/

    function openBuyOrder(uint256 pid, uint128 syntheticTokenAmount, uint128 _minSynTokenAmount, uint64 _synTokenPrice) whenNotPaused external {
        require(syntheticTokenAmount > _minSynTokenAmount,"SynPool: INSUFFICIENT_OUTPUT_AMOUNT");

        PoolInfo memory pool = poolInfo[pid];
        uint256 synTokenDecimal = pool.syntheticToken.decimals();
        uint256 systemCoinDecimal = systemCoin.decimals();
        uint256 _systemCoinAmount = syntheticTokenAmount * _synTokenPrice * 10 ** (systemCoinDecimal - synTokenDecimal - synPoolPriceDecimal);
        require(_systemCoinAmount >= minSystemCoinTxAmount && syntheticTokenAmount >= minSynTokenTxAmount, "<minTokenTx");

        _openBuyOrder(pid, 0, msg.sender, syntheticTokenAmount, _synTokenPrice, _minSynTokenAmount);
    }

    function openSellOrder(uint256 pid, uint128 _synTokenAmount, uint128 _minSystemCoinAmount, uint64 _synTokenPrice) whenNotPaused external {
        require(_minSystemCoinAmount >= minSystemCoinTxAmount && _synTokenAmount >= minSynTokenTxAmount, "<minTokenTx");
        PoolInfo memory pool = poolInfo[pid];
        uint128 synTokenDecimal = uint128(pool.syntheticToken.decimals());
        uint128 systemCoinDecimal = uint128(systemCoin.decimals());
        uint256 estSysCoinAmount = _synTokenAmount * _synTokenPrice * 10 ** (systemCoinDecimal -  synTokenDecimal - synPoolPriceDecimal);
        require(estSysCoinAmount > _minSystemCoinAmount, "SynPool: INSUFFICIENT_OUTPUT_AMOUNT");
        _openSellOrder(pid, 1, msg.sender, _synTokenAmount, _synTokenPrice, uint128(estSysCoinAmount), _minSystemCoinAmount);
    }

    function openLimitOrder(uint256 pid, uint8 orderType, uint128 _synTokenAmount, uint64 _synTokenPrice) whenNotPaused external {
        require(orderType == 0 || orderType == 1, "WrongOT");
        require(_synTokenAmount > 0 && _synTokenPrice > 0);
        if(orderType == 0) {
            _openBuyLimitOrder(pid, orderType, msg.sender, _synTokenAmount, _synTokenPrice);
        } else if(orderType ==1) {
            _openSellLimitOrder(pid, orderType, msg.sender, _synTokenAmount, _synTokenPrice);
        }
    }

    function closeOrder(uint256 pid, uint256 _orderId, uint128 _systemCoinAmount, uint128 _synTokenAmount) onlyAuthorized whenNotPaused external {
        require(_orderId < poolOrderLength[pid], "Invalid orderId");
        OrderInfo storage order = orderInfo[pid][_orderId];
        require(order.status == 0, "Order not open");

        if(order.orderType == 0) {
            require(_systemCoinAmount == 0 && _synTokenAmount > 0, "Invalid order0 input");
            _mintSynToken(pid, _orderId, _synTokenAmount);
        } else if(order.orderType == 1) {
            require(_systemCoinAmount > 0 && _synTokenAmount == 0, "Invalid order1 input");
            _burnSynToken(pid, _orderId, _systemCoinAmount);
        }
    }

    function cancelOrder(uint256 pid, uint256 _orderId) whenNotPaused external {
        require(_orderId < poolOrderLength[pid],"N/A");
        OrderInfo memory order = orderInfo[pid][_orderId];
        require(order.status == 0, "order not open");
        require(msg.sender == order.account, "Wrong User");
        _cancelOrder(pid, _orderId);
    }

    function cancelAllOrders(uint256 pid) whenNotPaused external {
        uint256 _userOrderLength = userOrderLength[pid][msg.sender];
        for (uint256 i = 0; i < _userOrderLength; i++) {
            uint256 _userOrderId = userOrderId[pid][msg.sender][i];
            OrderInfo memory order = orderInfo[pid][_userOrderId];
            if (order.status == 0) {
                require(order.status == 0, "order not open");
                require(msg.sender == order.account, "Wrong User");
                _cancelOrder(pid, _userOrderId);
            }
        }
    }

    function cancelOrderAuthorized(uint256 pid, uint256 _orderId) onlyAuthorized whenNotPaused external {
        require(_orderId < poolOrderLength[pid],"N/A");
        OrderInfo storage order = orderInfo[pid][_orderId];
        require(order.status == 0, "order Closed");
        _cancelOrder(pid, _orderId);
    }

    function _openBuyOrder(uint256 pid, uint8 orderType, address account, uint128 _synTokenAmount, uint64 _synTokenPrice, uint128 _minSynTokenAmount) internal{
        PoolInfo memory pool = poolInfo[pid];
        require(pool.mintsEnabled == true, "N/ME");
        uint256 synTokenDecimal = pool.syntheticToken.decimals();
        uint256 systemCoinDecimal = systemCoin.decimals();

        uint256 _systemCoinAmount = _synTokenAmount * _synTokenPrice * 10 ** (systemCoinDecimal - synTokenDecimal - synPoolPriceDecimal);
        systemCoin.safeTransferFrom(msg.sender, address(this), _systemCoinAmount + txFee);
        systemCoin.safeTransfer(reservePool, txFee);

        orderInfo[pid][poolOrderLength[pid]] = OrderInfo({
            account: account,
            systemCoinAmount: uint128(_systemCoinAmount),
            minSystemCoinAmount: 0,
            synTokenAmount: _synTokenAmount,
            minSynTokenAmount: _minSynTokenAmount,
            orderId: uint32(poolOrderLength[pid]),
            synTokenPrice: _synTokenPrice,
            openTime: uint64(block.timestamp),
            closeTime: 0,
            orderType: orderType,
            status: 0
        });

        userOrderId[pid][account][userOrderLength[pid][account]] = poolOrderLength[pid];
        emit OpenOrder(pid, orderType, poolOrderLength[pid], account, _systemCoinAmount, 0, _synTokenAmount, _minSynTokenAmount, _synTokenPrice);

        userOrderLength[pid][account]++;
        poolOrderLength[pid]++;
    }

