    function _mintSynToken(uint256 pid, uint256 _orderId, uint128 inputSynTokenAmount) internal {
        require(inputSynTokenAmount > 0, "<0");
        OrderInfo storage order = orderInfo[pid][_orderId];
        PoolInfo storage pool = poolInfo[pid];
        uint256 synTokenDecimal = pool.syntheticToken.decimals();
        uint256 syntheticPoolPrice = synPoolPrice[address(pool.syntheticToken)];

        (, bool validAmount) = verifyTol(order.orderType, order.systemCoinAmount, inputSynTokenAmount, syntheticPoolPrice, synTokenDecimal);
        require(validAmount == true,"exceed tol range");
        require(inputSynTokenAmount >= order.minSynTokenAmount && inputSynTokenAmount <= order.synTokenAmount,"exceed slippage range");

        order.status = 1;
        order.closeTime = uint64(block.timestamp);
        order.synTokenAmount = inputSynTokenAmount;

        pool.txAmount += order.systemCoinAmount;
        totalTxAmount += order.systemCoinAmount;
        pool.syntheticToken.mint(order.account, order.synTokenAmount);

        emit MintSynToken(pid, msg.sender, order.account, order.systemCoinAmount ,inputSynTokenAmount);
    }

    function _burnSynToken(uint256 pid, uint256 _orderId, uint128 inputSystemCoinAmount) internal {
        require(inputSystemCoinAmount > 0, "<0");
        PoolInfo storage pool = poolInfo[pid];
        OrderInfo storage order = orderInfo[pid][_orderId];
        uint256 synTokenDecimal = pool.syntheticToken.decimals();
        uint256 syntheticPoolPrice = synPoolPrice[address(pool.syntheticToken)];

        (, bool validAmount) = verifyTol(order.orderType, inputSystemCoinAmount, order.synTokenAmount, syntheticPoolPrice, synTokenDecimal);
        require(validAmount == true,"exceed tol range");
        require(inputSystemCoinAmount >= order.minSystemCoinAmount && inputSystemCoinAmount<=order.systemCoinAmount, "exceed slippage range");

        order.status = 1;
        order.closeTime = uint64(block.timestamp);
        order.systemCoinAmount = inputSystemCoinAmount;

        pool.txAmount += order.systemCoinAmount;
        totalTxAmount += order.systemCoinAmount;
        pool.syntheticToken.burn(order.synTokenAmount);

        uint256 systemCoinBalance = systemCoin.balanceOf(address(this));

        if (systemCoinBalance >= inputSystemCoinAmount) {
            systemCoin.safeTransfer(order.account, order.systemCoinAmount);
        } else {
            USBPool.borrowUSB(inputSystemCoinAmount - systemCoinBalance);
            systemCoin.safeTransfer(order.account, order.systemCoinAmount);
        }
        emit BurnSynToken(pid, msg.sender, order.account, inputSystemCoinAmount, order.synTokenAmount);
    }

    function _cancelOrder(uint256 pid, uint256 _orderId) internal {
        OrderInfo storage order = orderInfo[pid][_orderId];
        PoolInfo memory pool = poolInfo[pid];

        order.status = 2;
        order.closeTime = uint64(block.timestamp);
        if(order.orderType == 0) {
            uint256 systemCoinBalance = systemCoin.balanceOf(address(this));
            if (systemCoinBalance >= order.systemCoinAmount) {
                systemCoin.safeTransfer(order.account, order.systemCoinAmount);
            } else {
                USBPool.borrowUSB(order.systemCoinAmount - systemCoinBalance);
                systemCoin.safeTransfer(order.account, order.systemCoinAmount);
            }
        } else if(order.orderType == 1) {
            pool.syntheticToken.safeTransfer(order.account, order.synTokenAmount);
        }
        emit CancelOrder(pid, _orderId, msg.sender);
    }

    function verifyTol(uint256 orderType, uint256 inputSystemCoinAmount, uint256 inputSynTokenAmount, uint256 _synTokenPrice, uint256 synTokenDecimal) public view returns (uint256 estimatedReturn, bool tolStatus) {
        uint256 estimateAmount;
        uint128 systemCoinDecimal = uint128(systemCoin.decimals());
        if (orderType == 0) { 
            uint256 estSynTokenAmount = (inputSystemCoinAmount * 10 ** (synTokenDecimal)) / (_synTokenPrice * 10 ** (systemCoinDecimal - synPoolPriceDecimal));
            estimateAmount = estSynTokenAmount;
            uint256 tol = estimateAmount * tolCloseMargin / BIPS_DIVISOR;
            return(estimateAmount, (inputSynTokenAmount <= estimateAmount + tol) && (inputSynTokenAmount >= estimateAmount - tol));
        } else if (orderType == 1 ) {
            uint256 estSysCoinAmount = inputSynTokenAmount * _synTokenPrice * 10 ** (systemCoinDecimal -  synTokenDecimal - synPoolPriceDecimal);
            estimateAmount = estSysCoinAmount;
            uint256 tol = estimateAmount * tolCloseMargin / BIPS_DIVISOR;
            return(estimateAmount, (inputSystemCoinAmount <= estimateAmount + tol) && (inputSystemCoinAmount >= estimateAmount - tol));
        }
    }

